import React, { useEffect, useState } from 'react';
import { List, ListItem, ListItemText, Button } from '@mui/material';
import { getUsers, deleteUser } from '../services/api';
import { useNavigate } from 'react-router-dom';

const UserList = () => {
  const [users, setUsers] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    const response = await getUsers();
    setUsers(response.data);
  };

  const handleDelete = async (userId) => {
    await deleteUser(userId);
    fetchUsers();
  };

  return (
    <List>
      {users.map(user => (
        <ListItem key={user.id}>
          <ListItemText primary={user.username} secondary={user.role} />
          <Button variant="contained" color="primary" onClick={() => navigate(`/users/${user.id}`)}>View</Button>
          <Button variant="contained" color="secondary" onClick={() => handleDelete(user.id)}>Delete</Button>
        </ListItem>
      ))}
    </List>
  );
};

export default UserList;
